<!DOCTYPE html>
<html>
<head>
	<title></title>
	<link rel="stylesheet" type="text/css" href="css/style.css">
</head>
<body>
	<table cellpadding="0" cellspacing="0" border="0">
	    <tr>
	        <td colspan="2" class="double">&nbsp;</td>
	        <td colspan="2" class="double">&nbsp;</td>
	        <td colspan="2" class="yellow double">&nbsp;</td>
	    </tr>
	    <tr>
	        <td>&nbsp;</td>
	        <td colspan="3" rowspan="2" class="red">&nbsp;</td>
	        <td colspan="2" class="yellow fourfold">&nbsp;</td>
	    </tr>
	    <tr>
	        <td rowspan="2">&nbsp;</td>
	        <td class="fourfold">&nbsp;</td>
	        <td class="fourfold">&nbsp;</td>
	    </tr>
	    <tr>
	        <td class="black double">&nbsp;</td>
	        <td class="black">&nbsp;</td>
	        <td>&nbsp;</td>
	        <td colspan="2">&nbsp;</td>
	    </tr>
	    <tr>
	        <td rowspan="3" class="yellow">&nbsp;</td>
	        <td class="black double">&nbsp;</td>
	        <td class="black">&nbsp;</td>
	        <td>&nbsp;</td>
	        <td colspan="2" rowspan="2" class="blue">&nbsp;</td>
	    </tr>
	    <tr>
	        <td colspan="2" rowspan="2">&nbsp;</td>
	        <td class="black double-col">&nbsp;</td>
	    </tr>
	    <tr>
	        <td colspan="3">&nbsp;</td>
	    </tr>
	</table>
</body>
</html>
